$(document).ready(function () {

	var iframe = document.getElementsByTagName('iframe')[0];
	var iframeDoc = iframe.contentWindow.document;


	iframe.onload = function () {
		var videoWithControls = iframeDoc.getElementsByTagName('video')[0];
		videoWithControls.removeAttribute("controls");

		var playButton = document.querySelector('.play');
		var pauseButton = document.querySelector('.pause');
		playButton.style.opacity = "0";

		var videoContainer = document.querySelector('.for_video');

		videoContainer.addEventListener("click", function () {
			if (videoWithControls.paused == true) {
				// Play the video
				videoWithControls.play();

				pauseButton.style.opacity = "1";
				playButton.style.opacity = "0";
				setTimeout(function () {
					pauseButton.style.transition = "opacity 1s";
					pauseButton.style.opacity = "0";
				}, 1000);
			} else {
				// Pause the video
				videoWithControls.pause();

				pauseButton.style.opacity = "0";
				playButton.style.opacity = "1";
			}
		});

		videoContainer.addEventListener("mouseover", function () {
			if (videoWithControls.paused == false) {
				pauseButton.style.transition = "opacity 1s";
				pauseButton.style.opacity = "1";
			}
		});

		videoContainer.addEventListener("mouseout", function () {
			if (videoWithControls.paused == false) {
				pauseButton.style.transition = "opacity 1s";
				pauseButton.style.opacity = "0";

			}
		});
	};

	var menuButton = document.querySelector('#container');
	var siteOverlay = document.querySelector('.site-overlay');

	function menuOnLarge() {
		$("nav").removeClass('pushy pushy-left');
		$("nav > div").removeClass('pushy-content');
		$(".header_menuArea li").removeClass('pushy-link');
		$(".site-overlay").detach();
		$(".menu_button").detach();
	};

	function menuOnSmall() {
		$("nav").addClass('pushy pushy-left');
		$("nav > div").addClass('pushy-content');
		$(".header_menuArea li").addClass('pushy-link');
		$(siteOverlay).insertAfter(".header_menuArea_Ads");
		$(menuButton).insertAfter('.site-overlay');
	};

	window.onload = function () {
		var windowWidth = document.body.clientWidth;

		if (windowWidth > 760) {
			menuOnLarge();
		} else {
			menuOnSmall()
		}
	};

	window.onresize = function () {
		var windowWidth = document.body.clientWidth;

		if (windowWidth > 760) {
			menuOnLarge();
		} else {
			menuOnSmall();
		}
	};


	$("#carousel_main").owlCarousel({
		items: 4,
		loop: true,
		URLhashListener: true,
		startPosition: '#first',
		center: true,
		responsiveClass: true,
		responsive: {

			0: {
				items: 1,
			},

			580: {
				items: 2,
			},

			780: {
				items: 3,
			},

			1061: {
				items: 4,
			}
		}
	});

	$("#carousel_news").owlCarousel({

		loop: true,
		URLhashListener: true,
		startPosition: '#first',
		responsiveClass: true,
		responsive: {
			0: {
				items: 1,
			},

			480: {
				items: 2,
			},

			624: {
				items: 3,
			},

			815: {
				items: 4,
			},

			991: {
				items: 5,
			},

			1313: {
				items: 3,
			}
		}
	});

	$('.option').click(function () {
		$(this).addClass('for_opinion');
		$(this).siblings().removeClass('for_opinion');
	});

	$('.slider_posts .next').click(function () {
		var currentItem = $('.item_showed');
		var allItem = $('.slider_posts .item');

		function hideItem() {
			currentItem.removeClass('item_showed');
			currentItem.addClass('item_hidden');
		};


		if (currentItem[0] == allItem[allItem.length - 1]) {
			allItem.first().addClass("item_showed");
			allItem.first().removeClass("item_hidden");
			hideItem();
		} else {
			currentItem.next().addClass("item_showed");
			currentItem.next().removeClass("item_hidden");
			hideItem();
		};


	});

	$('.slider_posts .prev').click(function () {
		var currentItem = $('.item_showed');
		var allItem = $('.slider_posts .item');

		function hideItem() {
			currentItem.removeClass('item_showed');
			currentItem.addClass('item_hidden');
		};


		if (currentItem[0] == allItem[0]) {
			allItem.last().addClass("item_showed");
			allItem.last().removeClass("item_hidden");
			hideItem();
		} else {
			currentItem.prev().addClass("item_showed");
			currentItem.prev().removeClass("item_hidden");
			hideItem();
		};


	});

	$('.tag').click(function () {
		$(this).toggleClass('active');
	});

	function Calendar2(id, year, month) {
		var Dlast = new Date(year, month + 1, 0).getDate(),
			D = new Date(year, month, Dlast),
			DNlast = new Date(D.getFullYear(), D.getMonth(), Dlast).getDay(),
			DNfirst = new Date(D.getFullYear(), D.getMonth(), 1).getDay(),
			calendar = '<tr>',
			month = ["Январь", "Февраль", "Март", "Апрель", "Май", "Июнь", "Июль", "Август", "Сентябрь", "Октябрь", "Ноябрь", "Декабрь"];
		if (DNfirst != 0) {
			for (var i = 1; i < DNfirst; i++) calendar += '<td>';
		} else {
			for (var i = 0; i < 6; i++) calendar += '<td>';
		}
		for (var i = 1; i <= Dlast; i++) {
			if (i == new Date().getDate() && D.getFullYear() == new Date().getFullYear() && D.getMonth() == new Date().getMonth()) {
				calendar += '<td class="today">' + i;
			} else {
				calendar += '<td>' + i;
			}
			if (new Date(D.getFullYear(), D.getMonth(), i).getDay() == 0) {
				calendar += '<tr>';
			}
		}
		for (var i = DNlast; i < 7; i++) calendar += '<td>&nbsp;';
		document.querySelector('#' + id + ' tbody').innerHTML = calendar;
		document.querySelector('#' + id + ' thead td:nth-child(2)').innerHTML = month[D.getMonth()] + ' ' + D.getFullYear();
		document.querySelector('#' + id + ' thead td:nth-child(2)').dataset.month = D.getMonth();
		document.querySelector('#' + id + ' thead td:nth-child(2)').dataset.year = D.getFullYear();
		/*	if (document.querySelectorAll('#' + id + ' tbody tr').length < 6) { // чтобы при перелистывании месяцев не "подпрыгивала" вся страница, добавляется ряд пустых клеток. Итог: всегда 6 строк для цифр
				document.querySelector('#' + id + ' tbody').innerHTML += '<tr><td>&nbsp;<td>&nbsp;<td>&nbsp;<td>&nbsp;<td>&nbsp;<td>&nbsp;<td>&nbsp;';
			} */
	}
	Calendar2("calendar2", new Date().getFullYear(), new Date().getMonth());
	// переключатель минус месяц
	document.querySelector('#calendar2 thead tr:nth-child(1) td:nth-child(1)').onclick = function () {
		Calendar2("calendar2", document.querySelector('#calendar2 thead td:nth-child(2)').dataset.year, parseFloat(document.querySelector('#calendar2 thead td:nth-child(2)').dataset.month) - 1);
		$('#calendar2 tbody td').click(function () {
			$(this).toggleClass('day_check');
		});

	}
	// переключатель плюс месяц
	document.querySelector('#calendar2 thead tr:nth-child(1) td:nth-child(3)').onclick = function () {
		Calendar2("calendar2", document.querySelector('#calendar2 thead td:nth-child(2)').dataset.year, parseFloat(document.querySelector('#calendar2 thead td:nth-child(2)').dataset.month) + 1);
		$('#calendar2 tbody td').click(function () {
			$(this).toggleClass('day_check');
		});

	}

	$('#calendar2 tbody td').click(function () {
		$(this).toggleClass('day_check');
	});

});

